def is_beautiful(p, m):
    if m == 1:
        return True
    if m == 2:
        return p[0] != p[1]
    if m == 3:
        return p[0] != p[1] and p[0] != p[2] and p[1] != p[2]
    if m == 4:
        return p[0] != p[1] and p[0] != p[2] and p[0] != p[3] and p[1] != p[2] and p[1] != p[3] and p[2] != p[3]
    if m == 5:
        return p[0] != p[1] and p[0] != p[2] and p[0] != p[3] and p[0] != p[4] and p[1] != p[2] and p[1] != p[3] and p[1] != p[4] and p[2] != p[3] and p[2] != p[4] and p[3] != p[4]
    if m == 6:
        return p[0] != p[1] and p[0] != p[2] and p[0] != p[3] and p[0] != p[4] and p[0] != p[5] and p[1] != p[2] and p[1] != p[3] and p[1] != p[4] and p[1] != p[5] and p[2] != p[3] and p[2] != p[4] and p[2] != p[5] and p[3] != p[4] and p[3] != p[5] and p[4] != p[5]
    return False

t = int(input())
for i in range(t):
    n = int(input())
    p = list(map(int, input().split()))
    res = ""
    for m in range(1, n + 1):
        if is_beautiful(p, m):
            res += "1"
        else:
            res += "0"
    print(res)
